import React from "react";
import "./AddPlace.css";

import Box from "@mui/material/Box";
import TextField from "@mui/material/TextField";
import InputAdornment from "@mui/material/InputAdornment";
import Button from "@mui/material/Button";

const AddPlace = () => {
  return (
    <div className="addplace-container">
      <h1 style={{ color: "#343a40" }}> Add a Pet Friendly Place </h1>
      <div style={{ display: "flex" }}>
        <Box
          component="form"
          sx={{
            "& > :not(style)": { m: 1, width: "60ch" },
            display: "flex",
            flexDirection: "column",
          }}
          noValidate
          autoComplete="off"
        >
          <TextField id="outlined-basic" label="Title" variant="outlined" />
          <TextField id="outlined-basic" label="Address" variant="outlined" />
          <TextField id="outlined-basic" label="Longitude" variant="outlined" />
          <TextField id="outlined-basic" label="Latitude" variant="outlined" />
          <TextField
            id="outlined-basic"
            label="Open time"
            variant="outlined"
            type="datetime-local"
          />
          <TextField
            id="outlined-basic"
            label="Close time"
            variant="outlined"
            type="datetime-local"
          />
        </Box>
        <Box
          component="form"
          sx={{
            "& > :not(style)": { m: 1, width: "60ch" },
            display: "flex",
            flexDirection: "column",
          }}
          noValidate
          autoComplete="off"
        >
          <TextField
            id="outlined-basic"
            label="Postal Code"
            variant="outlined"
          />
          <TextField id="outlined-basic" label="Category" variant="outlined" />
          <TextField id="outlined-basic" label="Phone" variant="outlined" />
          <TextField id="outlined-basic" label="Email" variant="outlined" />
          <TextField
            id="outlined-start-adornment"
            sx={{ m: 1, width: "25ch" }}
            InputProps={{
              startAdornment: (
                <InputAdornment position="start">https://</InputAdornment>
              ),
            }}
          />
        </Box>
      </div>
      <Button variant="contained">Add Place</Button>
    </div>
  );
};

export default AddPlace;
